/** Author: Charles Dubout (charles.dubout@idiap.ch)
 *
 *  V1+ features, as described in Pinto, Cox, DiCarlo 'Why is Real-World
 *  Visual Object Recognition Hard?' 2008, and reported by Gehler and Nowozin
 *  'On Feature Combination for Multiclass Object Classification' 2009, as the
 *  best feature on the Caltech datasets.
 */

#include <mash/heuristic.h>

#include <algorithm>
#include <cmath>

using namespace Mash;
using namespace std;

//------------------------------------------------------------------------------
/// The 'V1Plus' heuristic class
//------------------------------------------------------------------------------
class V1PlusHeuristic: public Heuristic {
	//_____ Implementation of Heuristic __________
public:
	virtual unsigned int dim();
	virtual void prepareForImage();
	virtual scalar_t computeFeature(unsigned int feature_index);

private:
	// Do bilinear filtering
	float bilinear(float x, float y) const;

	// Convolve an image with a separable filter
	static int convolve(float* pixels, int width, int height,
						const float* row_kernel, int kernel_width,
						const float* col_kernel, int kernel_height,
						float* tmp = 0);

	// The filtered images
	vector<float> images_[96];

	// Epsilon
	static const double EPS = 1e-5;

	// The gabor filters (separated)
	static const float FILTERS[384][43];

	// The unit filter
	static const float ONES[17];
};

//------------------------------------------------------------------------------
/// Creation function of the heuristic
//------------------------------------------------------------------------------
extern "C" Heuristic* new_heuristic() {
	return new V1PlusHeuristic();
}

/************************* IMPLEMENTATION OF Heuristic ************************/

unsigned int V1PlusHeuristic::dim() {
	return 96 * 30 * 30;
}

void V1PlusHeuristic::prepareForImage() {
	// Dimensions of the image
	const int width = image->width();
	const int height = image->height();

	// Image preparation. First we converted the input image to grayscale and
	// resized by bicubic interpolation the largest edge to a fixed size (150
	// pixels for Caltech datasets) while preserving its aspect ratio. The mean
	// was subtracted from the resulting two-dimensional image and we divided it
	// by its standard deviation.
	float img[22500]; // The original image
	double sum = 0.0; // Sum of the pixel intensities
	double sumSq = 0.0; // Sum squared of the pixel intensities

	for (int i = 0; i < 150; ++i) {
		for (int j = 0; j < 150; ++j) {
			const float x = j * max(width, height) / 149.0f -
							max(height - width, 0) / 2.0f;
			const float y = i * max(width, height) / 149.0f -
							max(width - height, 0) / 2.0f;
			const float b = bilinear(x, y);
			img[i * 150 + j] = b;
			sum += b;
			sumSq += b * b;
		}
	}

	const double mean = sum / 22500.0;
	const double sd = sqrt(max(sumSq - sum * mean, 0.0) / 22499.0);
	const double invSd = 1.0 / (sd + EPS);

	for (int i = 0; i < 22500; ++i) {
		img[i] = (img[i] - mean) * invSd;
	}

	// Local input divisive normalization. For each pixel in the input image,
	// we subtracted the mean of the pixel values in a fixed window (3 x 3
	// pixels, centered on the pixel), and we divided this value by the
	// euclidean norm of the resulting 9-dimensional vector (3 x 3 window) if
	// the norm was greater than 1.
	float img1[22500]; // A first temporary image
	float img2[22500]; // A second temporary image
	float tmp[192]; // Temporary buffer

	for (int i = 0; i < 22500; ++i) {
		img1[i] = img[i];
		img2[i] = img[i] * img[i];
	}

	convolve(img1, 150, 150, ONES, 3, ONES, 3, tmp);
	convolve(img2, 150, 150, ONES, 3, ONES, 3, tmp);

	for (int i = 0; i < 22500; ++i) {
		const float mean = img1[i] / 9.0f;
		const float norm = sqrt(max(img2[i] - img1[i] * mean, 0.0f));
		img[i] = (img[i] - mean) / max(norm, 1.0f);
	}

	// Linear filtering with a set of Gabor filters. We convolved the normalized
	// images with a set of two-dimensional Gabor filters of fixed size (43 x 43
	// pixels), spanning 16 orientations (equally spaced around the clock) and
	// six spatial frequencies (1/2, 1/3, 1/4, 1/6, 1/11, 1/18 cycles/pixel)
	// with a fixed Gaussian envelope (standard deviation of 9 cycles/pixel in
	// both directions) and fixed phase (0) for a total of N 1Ú4 96 filters.
	// Each filter had zero-mean and euclidean norm of one.
	float imgSum[22500]; // Sum accross the filtered images
	float imgSumSq[22500]; // Sum squared accross the filtered images

	fill_n(imgSum, 22500, 0.0f);
	fill_n(imgSumSq, 22500, 0.0f);

	for (int i = 0; i < 96; ++i) {
		copy(img, img + 22500, img1);
		copy(img, img + 22500, img2);

		convolve(img1, 150, 150, FILTERS[i * 4], 43, FILTERS[i * 4 + 1], 43, tmp);
		convolve(img2, 150, 150, FILTERS[i * 4 + 2], 43, FILTERS[i * 4 + 3], 43, tmp);

		// Thresholding and saturation. The output of each Gabor filter was
		// passed through a standard output non-linearityÑa threshold and
		// response saturation. Specifically, all negative output values were
		// set to 0 and all values greater than 1 were set to 1.
		images_[i].resize(22500);

		for (int j = 0; j < 22500; ++j) {
			const float l = min(max(img1[j] + img2[j], 0.0f), 1.0f);
			images_[i][j] = l;
			imgSum[j] += l;
			imgSumSq[j] += l * l;
		}
	}

	// Local output divisive normalization. The result of the Gabor filtering
	// was a three-dimensional matrix of size H x W x N where each two-
	// dimensional slice (H x W) is the output of each Gabor filter type. For
	// each filter output, we subtracted the mean of filter outputs in a fixed
	// spatial window (3 x 3 pixels, centered) across all orientations and
	// spatial scales (total of 864 elements). We then divided by the euclidean
	// norm of the values in this window (864 elements), except when the norm
	// was less than 1.
	convolve(imgSum, 150, 150, ONES, 3, ONES, 3, tmp);
	convolve(imgSumSq, 150, 150, ONES, 3, ONES, 3, tmp);

	for (int i = 0; i < 22500; ++i) {
		const float mean = imgSum[i] / 864.0f;
		const float norm = sqrt(max(imgSumSq[i] - imgSum[i] * mean, 0.0f));
		const float invNorm = 1.0f / max(norm, 1.0f);

		for (int j = 0; j < 96; ++j) {
			images_[j][i] = (images_[j][i] - mean) * invNorm;
		}
	}

	// Dimensionality reduction. To speed computation and improve classification
	// performance, we reduced the dimensionality of the model output prior to
	// classification. The output of V1-like model (above) was a stack of 96
	// output images, one per Gabor filter type. Because the dimensionality of
	// this stack can be very high (up to 2,160,000 output values per input
	// image depending on its size), standard dimensionality reduction
	// techniques were used to prepare the data for classification.
	// Specifically, each of the 96 output images was low-pass filtered (17 x 17
	// boxcar) and down-sampled to a smaller size (30 3 30). Thus, regardless of
	// the original input image size, the total dimensionality for
	// classification was always 86,400 (30 x 30 x 96). The data were then
	// sphered (i.e., each filter output was standardized by subtraction of its
	// mean and division by its standard deviation across the training image
	// set...
	for (int i = 0; i < 96; ++i) {
		convolve(&images_[i][0], 150, 150, ONES, 17, ONES, 17, tmp);

		for (int y = 0; y < 30; ++y) {
			for (int x = 0; x < 30; ++x) {
				images_[i][y * 30 + x] = images_[i][y * 750 + x * 5 + 302];
			}
		}

		images_[i].resize(900);
	}
}

scalar_t V1PlusHeuristic::computeFeature(unsigned int feature_index) {
	return images_[feature_index / 900][feature_index % 900];
}

float V1PlusHeuristic::bilinear(float x, float y) const {
	// Dimensions of the image
	const int width = image->width();
	const int height = image->height();
	
	// Get the pixels values of the image
	byte_t** pixels = image->grayLines();
	
	// Adjust the coordinates origin
	x -= 0.5f;
	y -= 0.5f;
	
	// Clamp the coordinates
	x = min(max(x, 0.0f), width - 1.001f);
	y = min(max(y, 0.0f), height - 1.001f);
	
	// Bilinear interpolation
	int x0 = x;
	int x1 = x0 + 1;
	int y0 = y;
	int y1 = y0 + 1;
	
	float a = x - x0;
	float b = 1.0f - a;
	float c = y - y0;
	float d = 1.0f - c;
	
	return (pixels[y0][x0] * b + pixels[y0][x1] * a) * d +
	(pixels[y1][x0] * b + pixels[y1][x1] * a) * c;
}

// Compute the dot product between the vectors x and y
inline float dot(const float* x, const float* y, int n) {
	float sum = x[0] * y[0];

	int i;

	for (i = 1; i < n - 1; i += 2) {
		sum += x[i] * y[i] + x[i + 1] * y[i + 1];
	}

	if (i < n) {
		sum += x[i] * y[i];
	}

	return sum;
}

// Compute 2 dot products at a time, between x and y, and x + 1 and y
inline void dot2(const float* x, const float* y, int n, float* dots) {
	float sum0 = x[0] * y[0];
	float sum1 = x[1] * y[0];

	int i;

	for (i = 1; i < n - 1; i += 2) {
		sum0 += x[i    ] * y[i] + x[i + 1] * y[i + 1];
		sum1 += x[i + 1] * y[i] + x[i + 2] * y[i + 1];
	}

	if (i < n) {
		sum0 += x[i    ] * y[i];
		sum1 += x[i + 1] * y[i];
	}

	dots[0] = sum0;
	dots[1] = sum1;
}

// Compute 4 dot products at a time, between x + 0:3 and y
inline void dot4(const float* x, const float* y, int n, float* dots) {
	float sum0 = x[0] * y[0];
	float sum1 = x[1] * y[0];
	float sum2 = x[2] * y[0];
	float sum3 = x[3] * y[0];

	int i = 1;

	while (i < n - 3) {
		sum0 += x[i    ] * y[i] + x[i + 1] * y[i + 1] + x[i + 2] * y[i + 2] + x[i + 3] * y[i + 3];
		sum1 += x[i + 1] * y[i] + x[i + 2] * y[i + 1] + x[i + 3] * y[i + 2] + x[i + 4] * y[i + 3];
		sum2 += x[i + 2] * y[i] + x[i + 3] * y[i + 1] + x[i + 4] * y[i + 2] + x[i + 5] * y[i + 3];
		sum3 += x[i + 3] * y[i] + x[i + 4] * y[i + 1] + x[i + 5] * y[i + 2] + x[i + 6] * y[i + 3];
		i += 4;
	}

	if (i < n - 1) {
		sum0 += x[i    ] * y[i] + x[i + 1] * y[i + 1];
		sum1 += x[i + 1] * y[i] + x[i + 2] * y[i + 1];
		sum2 += x[i + 2] * y[i] + x[i + 3] * y[i + 1];
		sum3 += x[i + 3] * y[i] + x[i + 4] * y[i + 1];
		i += 2;
	}

	if (i < n) {
		sum0 += x[i    ] * y[i];
		sum1 += x[i + 1] * y[i];
		sum2 += x[i + 2] * y[i];
		sum3 += x[i + 3] * y[i];
	}

	dots[0] = sum0;
	dots[1] = sum1;
	dots[2] = sum2;
	dots[3] = sum3;
}

int V1PlusHeuristic::convolve(float* pixels, int width, int height,
							  const float* row_kernel, int kernel_width,
							  const float* col_kernel, int kernel_height,
							  float* tmp) {
	// Error 1: the image is empty
	if (!pixels || width < 1 || height < 1) {
		return 1;
	}

	// Error 2: the kernel is empty
	if (!row_kernel || !col_kernel || kernel_width < 1 || kernel_height < 1) {
		return 2;
	}

	// Error 3: the kernel has an even dimension
	if (!(kernel_width & 1) || !(kernel_height & 1)) {
		return 3;
	}

	// Temporary buffer
	bool release = false;

	if (!tmp) {
		tmp = new float[std::max(width + kernel_width - 1,
								 height + kernel_height - 1)];

		release = true;
	}

	// Error 4: could not allocate temporary buffer
	if (!tmp) {
		return 4;
	}

	// Area (number of pixels in the image)
	const int area = width * height;

	// Half kernel dimensions
	const int half_width = kernel_width >> 1;
	const int half_height = kernel_height >> 1;

	// Convolve rows
	for (int y = 0; y < height; ++y) {
		// Pad the image so that there is no need to test boundary conditions
		std::fill_n(tmp, half_width, pixels[0]);
		std::copy(pixels, pixels + width, tmp + half_width);
		std::fill_n(tmp + half_width + width, half_width, pixels[width - 1]);

		int x;

		for (x = 0; x < width - 3; x += 4) {
			dot4(tmp + x, row_kernel, kernel_width, pixels + x);
		}

		if (x < width - 1) {
			dot2(tmp + x, row_kernel, kernel_width, pixels + x);
			x += 2;
		}

		if (x < width) {
			pixels[width - 1] = dot(tmp + x, row_kernel, kernel_width);
		}

		pixels += width;
	}

	pixels -= area;

	// Convolve columns
	for (int x = 0; x < width; ++x) {
		// Pad the image so that there is no need to test boundary conditions
		std::fill_n(tmp, half_height, pixels[0]);

		for (int y = 0; y < height; ++y) {
			tmp[y + half_height] = pixels[0];
			pixels += width;
		}

		std::fill_n(tmp + half_height + height, half_height, pixels[-width]);
		pixels -= area;

		int y;

		for (y = 0; y < height - 3; y += 4) {
			float dots[4];
			dot4(tmp + y, col_kernel, kernel_height, dots);
			pixels[0] = dots[0];
			pixels[width] = dots[1];
			pixels[width << 1] = dots[2];
			pixels[(width << 1) + width] = dots[3];
			pixels += width << 2;
		}

		if (y < height - 1) {
			float dots[2];
			dot2(tmp + y, col_kernel, kernel_height, dots);
			pixels[0] = dots[0];
			pixels[width] = dots[1];
			pixels += width << 1;
			y += 2;
		}

		if (y < height) {
			pixels[0] = dot(tmp + y, col_kernel, kernel_height);
			pixels += width;
		}

		pixels -= area - 1;
	}

	if (release) {
		delete[] tmp;
	}

	return 0;
}

